import React from 'react';
import { connect } from 'react-redux';
import styled from 'styled-components';
import { deleteUser } from '../../actions/auth';
import Landing from '../layout/Landing';
import GlobalButton from '../../styled/GlobalButton';

const StyledButton = styled(GlobalButton)`
	display: inline-block;
`;

const DeleteUser = ({ deleteUser }) => {
	return <StyledButton onClick={deleteUser}>Delete Account</StyledButton>;
};
const mapStateToProps = (state) => ({
	deleteUser,
});

export default connect(mapStateToProps, { deleteUser })(DeleteUser);
